import React, { useState, useEffect } from 'react';

const Goal = () => {
  const [goals, setGoals] = useState([]);
  const [newGoal, setNewGoal] = useState({
    name: '',
    targetValue: 0,
    progress: 0,
    deadline: '',
    isDraft: true,
  });

  const fetchGoals = async () => {
    try {
      const response = await fetch('http://localhost:7087/api/goals');
      const data = await response.json();
      setGoals(data);
    } catch (error) {
      console.error('Error fetching goals:', error);
    }
  };

  const handleCreateGoal = async () => {
    try {
      const response = await fetch('http://localhost:7087/api/goals', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(newGoal),
      });

      if (response.ok) {
        fetchGoals();
        setNewGoal({
          name: '',
          targetValue: 0,
          progress: 0,
          deadline: '',
          isDraft: true,
        });
      } else {
        alert('Error creating goal');
      }
    } catch (error) {
      console.error('Error creating goal:', error);
    }
  };

  const handleUpdateGoal = async (goal) => {
    try {
      const response = await fetch(
        `http://localhost:7087/api/goals/${goal.id}`,
        {
          method: 'PUT',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(goal),
        }
      );

      if (response.ok) {
        fetchGoals();
      } else {
        alert('Error updating goal');
      }
    } catch (error) {
      console.error('Error updating goal:', error);
    }
  };

  const handleDeleteGoal = async (id) => {
    try {
      const response = await fetch(`http://localhost:7087/api/goals/${id}`, {
        method: 'DELETE',
      });

      if (response.ok) {
        fetchGoals();
      } else {
        alert('Error deleting goal');
      }
    } catch (error) {
      console.error('Error deleting goal:', error);
    }
  };

  useEffect(() => {
    fetchGoals();
  }, []);

  return (
    <div>
      <h1>Goals</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Target Value</th>
            <th>Progress</th>
            <th>Deadline</th>
            <th>Is Draft</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {goals.map((goal) => (
            <tr key={goal.id}>
              <td>{goal.name}</td>
              <td>{goal.targetValue}</td>
              <td>{goal.progress}</td>
              <td>{goal.deadline}</td>
              <td>{goal.isDraft ? 'Yes' : 'No'}</td>
              <td>
                <button
                  onClick={() =>
                    handleUpdateGoal({ ...goal, isDraft: !goal.isDraft })
                  }
                >
                  {goal.isDraft ? 'Finalize' : 'Mark as Draft'}
                </button>
                <button onClick={() => handleDeleteGoal(goal.id)}>
                  Delete
                </button>
              </td>
            </tr>
          ))}
          <tr>
            <td>
              <input
                type='text'
                placeholder='Name'
                value={newGoal.name}
                onChange={(e) =>
                  setNewGoal({ ...newGoal, name: e.target.value })
                }
              />
            </td>
            <td>
              <input
                type='number'
                placeholder='Target Value'
                value={newGoal.targetValue}
                onChange={(e) =>
                  setNewGoal({ ...newGoal, targetValue: e.target.value })
                }
              />
            </td>
            <td>
              <input
                type='number'
                placeholder='Progress'
                value={newGoal.progress}
                onChange={(e) =>
                  setNewGoal({ ...newGoal, progress: e.target.value })
                }
              />
            </td>
            <td>
              <input
                type='date'
                value={newGoal.deadline}
                onChange={(e) =>
                  setNewGoal({ ...newGoal, deadline: e.target.value })
                }
              />
            </td>
            <td>
              <input
                type='checkbox'
                checked={newGoal.isDraft}
                onChange={(e) =>
                  setNewGoal({ ...newGoal, isDraft: e.target.checked })
                }
              />
            </td>
            <td>
              <button onClick={handleCreateGoal}>Add Goal</button>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Goal;
